// Import necessary dependencies
import React from 'react';
import ReactDOM from 'react-dom';
import ShopPage from './ShopPage'

// Import your main App component
import App from './App'; // Adjust the path based on your project structure

// Render the App component into the root element of the HTML document
ReactDOM.render(
  <React.StrictMode>
    <ShopPage />
  </React.StrictMode>,
  document.getElementById('heartApp') // Use the same id as in public/index.html
);
